import { programReducer } from './programReducer';
import { workoutReducer } from './workoutReducer';
import { exerciseReducer } from './exerciseReducer';
import { setReducer } from './setReducer.js';
import { activeWorkoutReducer } from './activeWorkoutReducer.js';

const combineReducers = reducers => {
  return (state = {}, action) => {
    let hasChanged = false;
    const nextState = {};
    console.log('Root state at combineReducers start:', state);

    Object.keys(reducers).forEach(key => {
      const reducer = reducers[key];
      const nextStateForKey = reducer(state, action);
      nextState[key] = nextStateForKey;
      hasChanged = hasChanged || nextStateForKey !== state[key];
    });
    console.log('Next state after combineReducers:', nextState);
    return hasChanged ? nextState : state;
  };
};

const rootReducer = combineReducers({
  programs: programReducer,
  workouts: workoutReducer,
  exercises: exerciseReducer,
  sets: setReducer,
  activeWorkout: activeWorkoutReducer
});

export default rootReducer;
